import { useState, useEffect } from "react"
import { useParams } from "react-router-dom"

export const MyRequest = () => {

    const {clientId} = useParams()
    const [genre, setGenres] = useState([])
    const [client, setClients] = useState({})


   useEffect( 
    () => { 
        fetch(`http://localhost:8088/requests?_expand=genre`)
            .then(response=>response.json())
            .then((genreInfo) => { 
                setGenres(genreInfo)
            })
    }
   )

    useEffect(
        () => {
            fetch(`http://localhost:8088/clients?_expand=user&_embed=requests=${clientId}`)
                .then(response => response.json())
                .then((clientInfo) => {
                    const singleClient = clientInfo[0]
                    setClients(singleClient)
                })
        },
        [clientId]
    )


    return (
        <div className="requestInfo">
            <h2>My Request</h2>
            <div>Name: {client?.user?.fullName}</div>
            <div>Email: {client?.user?.email}</div>
            <div>Start Date: {client?.request?.startDate}</div>
            <div>End Date: {client?.request?.endDate}</div>
